import * as checkers from "./checkers";

let prevState; 
export default class Observer{
    constructor(store){
        this.store = store;
    }

    check(){
        let state = this.store.getState().console;
        for( let [key, fun] of checkers){
            console.log("iterate", key, fun)
        }
        console.log(checkers);
        prevState = state;
    }  
}
